  false,\n\t\"url\": null,\n\t\"notes\": \"This draft Comprehensive Conservation Plan
  (CCP) was written to guide management on Cokeville Meadows NWR for the next 15 years.
  This plan outlines the Refuge vision and purpose and describes how the NWR will
  contribute to the overall mission of the Refuge System. The plan provides an introduction
  to the Refuge, an overview of the CCP planning process, goals and objectives, alternatives,
  information about the management direction, a description of the affected environment,
  and environmental consequences.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
